import React, { Component } from 'react';
import '../App.css';

export default class Blog extends Component {
    render() {
        return(
            <div className="Blog">
                {this.props.blogImg}
                {this.props.blogTime}
                {this.props.blogTitle}
                {this.props.blogCate}
                {this.props.blogTitle}
                {this.props.blogContent}
            </div>
        )
    }
}
